import React from 'react';
import { FormControl, Input, InputLabel} from '@material-ui/core';

export const Form = () => {
  return (
    <div>
      <FormControl>
        <InputLabel htmlFor="todo-input">Todo</InputLabel>
        <Input type="text" id="todo-input" />
      </FormControl>
    </div>
  )
}
